import React, { useState, useEffect } from 'react'

function App() {
    const [info, setInfo] = useState([])

    useEffect(() => {
        fetch('http://localhost:4000/tacos')
            .then((r)=>r.json())
            .then((stuff)=>setInfo(stuff))
    }, [])

    console.log(info)

    return(
        <h1>Hello World!</h1>
    )
}
export default App
